import React from 'react';
import { useQuery, gql } from '@apollo/client';

const details = gql`
query pokemon($name: String!) {
    pokemon(name: $name) {
      id
      name
      abilities {
        ability {
          name
        }
      }
      moves {
        move {
          name
        }
      }
      types {
        type {
          name
        }
      }
      message
      status
    }
  }
`;

function Pokemon(props){
    return(
    <div key={props.pokemon.name}>
        <p>
            {props.pokemon.name} <img src={props.pokemon.image} alt="pokemon"></img>
        </p>
    </div>
    );
};
